iLoveDaemonBlurb=<p>Daemon\ Pty\ Ltd,\ the\ creators\ of\ the\ FarCry\ Content\ Management\ System,\ offers\ a\ wide\ range\ of\ support\ offerings\ to\ assist\ organisations\ with\ their\ FarCry\ implementation.</p>\ <p>Our\ support\ offerings\ deliver\ real\ business\ benefits\ by\ providing\ organisations\ with\ specialised\ technical\ support\ and\ guaranteed\ fast\ turn-around\ time\ on\ incidents.\ \ </p>\ <p>Our\ technical\ staff\ are\ Macromedia\ Certified\ Developers\ and\ are\ especially\ qualified\ to\ quickly\ and\ accurately\ answer\ technical\ inquiries.\ \ Over\ 8\ years\ experience\ as\ a\ Macromedia\ Solutions\ Partner\ and\ Macromedia\ Authorised\ Training\ Centre\ has\ produced\ a\ base\ of\ knowledgeable\ and\ professional\ expertise\ that\ is\ second-to-none.</p>\ <p>A\ number\ of\ different\ support\ plans\ are\ available\ and\ vary\ with\ the\ nature\ of\ the\ supported\ FarCry\ server\ platform.\ There\ are\ economical,\ low-volume\ packages\ for\ smaller\ installations\ and\ 24/7/365\ offerings\ with\ bundled\ site\ analysis\ for\ larger\ ones.</p>\ <p>Support\ packages\ bundle\ hours\ of\ technical\ support\ with\ several\ value-added\ components\ such\ as\ technical\ conference\ calls\ and\ Internet-based\ seminars.\ To\ discuss\ your\ requirements\ call\ (612)\ 9380-4162\ or\ email\ sales@daemon.com.au.\ </p>
